import { Box, Heading, Text } from '@chakra-ui/react';

const Home = () => {
  return (
    <Box p={4}>
      <Heading as="h2" size="lg" mb={4}>
        Home
      </Heading>
      <Text fontSize="xl" mb={4}>
        Welcome to the NBA Betting Arbitrage Tool!
      </Text>
      <Text fontSize="lg">
        Select an option from the navigation menu to get started.
      </Text>
    </Box>
  );
};

export default Home;
